import "./Footer.css";
import dataFooter from "../../../../data/footer.json";
const Footer = () => {
  return (
    <footer>
      {dataFooter.map((column, index) => {
        return <div key={index} className=""></div>;
      })}
    </footer>
  );
};
export default Footer;
